import React, { Component } from "react";
import Pdf from "./src/resume.pdf";

class Resume extends Component {
  state = {};
  render() {
    return (
      <div>
        <a href={Pdf} target="_blank">
          Download Pdf
        </a>
      </div>
    );
  }
}

export default Resume;
